@media (max-width:1237px) {
  #id_n {
    white-space: nowrap;
    overflow: hidden;
    text-overflow: ellipsis;
    max-width: 100px;
    display: inline-block;
  }
}

.rwds_svg {
  vertical-align: top;
  display: inline-block;
}

.rwds_svg.mobile {
  float: left;
}

.rwds_svg.serp {
  margin: 8px 0 0 8px;
}

.rwds_svg.serp.mobile {
  margin: 8px 4px 0 8px;
}

.rwds_svg.hp {
  margin: 5px 4px 0 8px;
}

.rwds_svg.hp.mobile {
  margin: 5px 4px 0 10px;
}

.rhlined,
.rhfill {
  vertical-align: top;
  width: 32px;
  height: 32px;
}

#id_rh {
  position: relative;
}

.rhcoinflip {
  vertical-align: top;
  width: 60px;
  height: 60px;
  position: absolute;
  right: -6px;
  top: -6px;
}

#idCont .rhcoinflip {
  position: absolute;
  right: -5px;
  top: -9px;
}

#rh_meter {
  vertical-align: top;
  width: 40px;
  height: 40px;
  margin-left: -36px;
  margin-top: -4px;
}

.rh_reedm .rhlined,
.rhfill,
.rh_reedm .meter {
  display: none;
}

.rhlined,
.rh_reedm .rhfill,
#rh_meter {
  display: inline-block;
}

.rd_hide {
  visibility: hidden;
}

.rhlined.hp .meter,
.rhfill.hp .meter {
  stroke: rgba(255,255,255,.4);
}

.noBg .rhlined.hp .meter,
.noBg .rhfill.hp .meter,
.rhlined.serp .meter,
.rhfill.serp .meter {
  stroke: rgba(177,177,177,.4);
}

.rhlined.hp .medal,
.rhfill.hp .medal {
  fill: white;
}

.noBg .rhlined.hp .medal,
.rhlined.serp .medal {
  fill: #919191;
}

.noBg .rh_reedm .rhfill.hp .medal,
.rh_reedm .rhfill.serp .medal {
  fill: #00809d;
}

#rh_animcrcl {
  fill: none;
  stroke: transparent;
  stroke-width: 0;
}

#rh_animcrcl.anim {
  stroke-width: 2;
}

#rh_animcrcl.anim.hp {
  stroke: white;
}

@media screen and (-ms-high-contrast:black-on-white) {
  .rhlined.hp .medal,
  .rhfill.hp .medal {
    fill: black;
  }

  #rh_animcrcl.anim.hp {
    stroke: black;
  }
}

#rh_animcrcl.serp.anim {
  stroke: #00809d;
}

#rh_animpath.serp.anim {
  fill: #00809d;
}

.noBg #rh_animcrcl.anim.hp {
  stroke: #00809d;
}

.rh_scale .rhfill,
.rh_scale #rh_meter {
  animation: scaling .4s cubic-bezier(.3,.55,.1,1);
}

@-webkit-keyframes scaling {
  0% {
    transform: scale(1,1);
  }

  50% {
    transform: scale(1.3,1.3);
  }

  100% {
    transform: scale(1,1);
  }
}

@keyframes scaling {
  0% {
    transform: scale(1,1);
  }

  50% {
    transform: scale(1.3,1.3);
  }

  100% {
    transform: scale(1,1);
  }
}

#tallhead #idMobileCont {
  position: absolute;
}

#tallhead #idMobileCont>* {
  top: 3px;
}

#idMobileCont>* {
  vertical-align: top;
  display: inline-block;
  top: 10px;
}

#idMobileCont #id_rh {
  font-size: .8125rem;
  position: relative;
  margin-top: 2px;
}

#idMobileCont #id_rh #id_rc.hp {
  color: #fff;
  line-height: 38px;
}

#idMobileCont #id_rh #id_rc.serp {
  color: #000;
  line-height: 45px;
}

.bnc-hci {
  position: relative;
  top: 4px;
  padding-left: 8px;
}

html,
body {
  font-family: "Segoe UI",Segoe,Tahoma,Arial,Verdana,sans-serif;
  background-color: rgba(34,34,34,.9);
  overflow: hidden;
  width: 100%;
  height: 100%;
}

html,
body,
a,
div,
span,
table,
tr,
td,
strong,
ul,
ol,
li,
h1,
h2,
h3,
p,
input {
  font-weight: inherit;
  font-size: inherit;
  list-style: none;
  border-spacing: 0;
  border: 0;
  border-collapse: collapse;
  text-decoration: none;
  padding: 0;
  margin: 0;
}

a {
  color: initial;
}

a:hover,
a.\:hover {
  text-decoration: none;
}

object {
  position: absolute;
}

video::-webkit-media-controls {
  display: none !important;
}

input[type="search"]::-webkit-search-decoration,
input[type="search"]::-webkit-search-cancel-button,
input[type="search"]::-webkit-search-results-button,
input[type="search"]::-webkit-search-results-decoration {
  display: none;
}

body:not(.tabbing) *:focus {
  outline: none;
}

.hpapp {
  height: 100%;
}

.hp_body,
.hp_cont {
  height: 100%;
}

.hide,
.b_hide,
.bnc-hide,
.invtesthooks {
  display: none !important;
}

.show {
  display: block !important;
}

.hidden {
  visibility: hidden;
}

.hp_body {
  min-width: 768px;
  min-height: 360px;
  background-color: #555;
}

.hp_body.no_image {
  background-color: #f5f5f5;
}

.hp_body.no_image .img_cont,
.hp_body.no_image .shaders,
.hp_body.no_image .dimmer,
.hp_body.no_image .birthday {
  display: none;
}

.hp_body.no_image #bLogo {
  filter: none;
}

.hp_body.no_image #bLogo .ms_text,
.hp_body.no_image #bLogo .b_text {
  fill: #666;
}

.hp_body.no_image .sbox {
  margin: auto;
}

.hp_body.no_image .sbox .below_sbox {
  color: #666;
  text-shadow: none;
}

.hp_body.no_image .sbox .below_sbox .text,
.hp_body.no_image .sbox .below_sbox a {
  color: #666;
}

.hp_body.no_image .holiday_controls,
.hp_body.no_image .holiday_video,
.hp_body.no_image .holiday_effects {
  display: none !important;
}

.img_cont {
  background-position: center;
  background-size: cover;
  bottom: 0;
  right: 0;
  left: 0;
  top: 0;
  position: fixed;
}

.img_cont .img_uhd {
  opacity: 0;
  background-size: cover;
  background-position: center;
  bottom: 0;
  right: 0;
  left: 0;
  top: 0;
  position: absolute;
}

.img_cont .bg_video {
  object-fit: cover;
  left: 50%;
  top: 50%;
  transform: translate3d(-50%,-50%,0);
  position: absolute;
  height: 100%;
  width: 100%;
}

.img_cont .bg_video.fadeOut {
  opacity: 0;
}

.img_cont .bg_audio {
  display: none;
}

.hp_cont {
  width: 80%;
  margin: auto;
  position: relative;
}

@media screen and (min-width:2240px) {
  .hp_cont {
    width: 1792px;
  }
}

.dimmer {
  position: fixed;
  width: 100%;
  height: 100%;
  left: 0;
  top: 0;
  pointer-events: none;
  transition: background-color .2s;
}

.dimmer.dim {
  z-index: 2;
  pointer-events: all;
  background-color: rgba(0,0,0,.6);
}

.shaders {
  position: fixed;
  height: 100%;
  width: 100%;
  left: 0;
  top: 0;
}

.shaders .topLeft,
.shaders .topRight,
.shaders .bottom {
  height: 28%;
  position: absolute;
}

.shaders .topLeft {
  left: 0;
  width: 100%;
  background: linear-gradient(to bottom left,rgba(0,0,0,.5) -20%,transparent 30%);
}

.shaders .topRight {
  right: 0;
  width: 100%;
  background: linear-gradient(to bottom right,rgba(0,0,0,.5) -20%,transparent 30%);
}

.shaders .bottom {
  background: linear-gradient(to bottom,transparent 0%,rgba(0,0,0,.6) 100%);
  bottom: 0;
  left: 0;
  width: 100%;
}

.sbox {
  width: 78%;
  box-sizing: border-box;
  min-height: 40px;
  max-height: 52px;
  height: 100%;
  min-width: 580px;
  max-width: 596px;
  white-space: nowrap;
  top: 15%;
  position: relative;
  z-index: 2;
  margin: 0 0 0 228px;
}

.sbox * {
  box-sizing: inherit;
}

.sbox.fix {
  top: 40px !important;
  transform: none !important;
}

.sbox .logo,
.sbox .sb_form {
  display: inline-block;
  vertical-align: middle;
}

.sbox .logo {
  width: 20%;
  height: 100%;
}

.sbox .logo svg {
  height: 100%;
  width: 100%;
}

.sbox .sb_form {
  width: 100%;
  background-color: transparent;
  font: normal 1rem "Segoe UI",Arial,Helvetica,Sans-Serif;
  padding-right: 10px;
  box-shadow: 0 2px 4px rgba(0,0,0,.3);
  align-items: center;
  justify-content: flex-end;
  display: inline-flex;
  border-radius: 6px;
  height: 100%;
  position: relative;
  background-color: #fff;
}

.sbox .sb_form svg {
  height: 100%;
  width: 100%;
}

.sbox .sb_form input[type=search]::-ms-clear,
.sbox .sb_form input[type=search]::-ms-reveal {
  display: none;
  width: 0;
  height: 0;
}

.sbox .sb_form .sb_form_q {
  background-color: transparent;
  padding: 12px 10px;
  flex: 1;
  border: 0;
  outline: none;
  -webkit-appearance: none;
  font-size: 1.125rem;
  font: inherit;
}

.sbox .sb_form .sb_form_q:focus~#sw_as,
.sbox .sb_form .sb_form_q:active~#sw_as {
  display: block;
}

.sbox .sb_form .sb_form_q:focus~#sw_as .sa_as,
.sbox .sb_form .sb_form_q:active~#sw_as .sa_as {
  display: block;
}

.sbox .sb_form .icon {
  position: relative;
  min-width: 28px;
  margin: auto 4px;
  height: 45%;
  width: 5%;
}

.sbox .sb_form #vkeyIcon {
  width: 100%;
  height: 100%;
}

.sbox .sb_form .search,
.sbox .sb_form #vkeyIcon {
  cursor: pointer;
}

.sbox .sb_form #sb_form_go {
  padding: 0;
  height: 0;
  width: 0;
  outline: none;
  border: none;
  position: absolute;
}

.sbox .sb_form #sb_form_go:focus {
  outline: -webkit-focus-ring-color auto 1px;
  width: 35px;
  height: 27px;
  background-color: transparent;
}

.sbox .sb_form #sw_as {
  left: 0;
  height: auto;
  right: 10px;
  top: 100%;
  position: absolute;
  padding-top: 8px;
  margin-top: -8px;
  display: none;
  box-sizing: content-box;
}

.sbox .sb_form #sw_as .sa_as {
  position: relative;
  display: none;
}

.sbox .sb_form #sw_as .sa_as.sa_nw:not(:empty) {
  margin-left: 0;
  width: initial;
}

.sbox .sb_form #sw_as .sa_as.sa_nw:not(:empty) .sa_drw:not(:empty) {
  margin-top: 0;
}

.sbox .sb_form #sw_as .sa_as.sa_nw {
  position: absolute;
}

.sbox .sb_form #sw_as .sa_as .sa_drw {
  overflow: hidden;
  border-radius: 0 0 6px 6px;
  background-color: #fff;
}

.sbox .sb_form #sw_as .sa_as .sa_drw:not(:empty) {
  border-top: 1px solid rgba(0,0,0,.2);
  overflow: hidden;
}

.sbox .sb_form #sw_as .sa_as .sa_drw:not(:empty):before {
  width: 100%;
  height: 8px;
  top: -8px;
  position: absolute;
  background-color: #fff;
  content: '';
}

.sbox .sb_form #sw_as .sa_as .sa_drw li,
.sbox .sb_form #sw_as .sa_as .sa_drw .nowrap {
  white-space: nowrap;
}

.sbox .sb_form #sw_as .sa_as .sa_drw .sa_hd {
  margin-left: 17px;
  font-size: .6875rem;
  line-height: 16px;
}

.sbox .sb_form #sw_as .sa_as .sa_drw .sa_sg {
  cursor: pointer;
}

.sbox .sb_form #sw_as .sa_as .sa_drw .sa_sg .sa_tm {
  margin-left: 17px;
  line-height: 36px;
}

.sbox .sb_form #sw_as .sa_as .sa_drw .pp_title {
  color: inherit;
}

.sbox .sb_form input[type='search']::-webkit-search-decoration,
.sbox .sb_form input[type='search']::-webkit-search-cancel-button,
